import logo192 from "../logo.svg";
import "../styles/Article.css";

function Article() {
    return (
        <div className="hero-ctn">
            {/* H1,2,3 ? */}
            <h2>La digitalisation à votre portée</h2>
            <p>
                Spark Studio est la solution pour développer le chiffre
                d'affaires de votre activité ! Nous vous accompagnons et vous
                conseillons dans la mise en place de votre stratégie digitale.
            </p>
            <p>
                Grace à notre large gamme d'outils nous vous permettons de créer
                des expériences exceptionnelles pour vos clients et tout cela
                modulable en fonction de vos besoins/envies.
            </p>
            <button>demander une demo</button>
        </div>
    );
}
export default Article;
